import React from 'react';

import srcArrowLeft from "../../../images/bunch/marketing/curve-arrow.svg";
import srcArrowDown from "../../../images/bunch/marketing/arrow-down.png";

import { useMediaQuery } from "react-responsive";

import { Element } from "react-scroll/modules";

import * as ReactGA from "react-ga";

import Countdown from 'on-react-countdown';

import {
    Tab,
    Tabs,
    TabList,
    TabPanel
} from 'react-tabs';

import Linkify from "react-linkify";


const BlockHourWithCompany = ({
                                 videoId,
                                 isTranslationOn,
                             }) => {
    const isTabletOrMobileDevice
        = useMediaQuery(
            {
                maxDeviceWidth: 1224
            }
        );

    if (isTabletOrMobileDevice)
        return (
            <div>
                <div className="container padding-stand-top">
                    <div className="row">
                        <div className="col-12 col-lg-6">
                            <p className="stand-banner-title">Година з компанією</p>
                            <p className="stand-banner-explanation">
                                Хочеш познайомитись ближче з представниками компанії, дізнатись круті робочі можливості? Welcome, ти знаходишся у потрібному місці!
                            </p>
                        </div>
                        <div
                            className="col-12 col-lg-6 align-center justify-content-center-desktop">
                            <div>
                                {/*<div className="col-12 text-center">*/}
                                    {/*<p className="countdown-banner-text">*/}
                                        {/*Залишилось до ярмарки*/}
                                    {/*</p>*/}

                                    {/*<div className="countdown-timer mt-4">*/}
                                        {/*<Countdown*/}
                                            {/*alwaysDoubleDigit={true}*/}
                                            {/*wordsOff={true}*/}
                                            {/*text={{*/}
                                                {/*days: ['день', 'днів', 'днів'],*/}
                                                {/*hours: ['година', 'годин', 'годин'],*/}
                                                {/*minutes: ['хвилина', 'хвилини', 'хвилин'],*/}
                                                {/*seconds: ['секунда', 'секунд', 'секунд'],*/}
                                            {/*}}*/}
                                            {/*end={1601107200}*/}
                                        {/*/>*/}
                                    {/*</div>*/}
                                    {/*<div className="names-count-row justify-content-center">*/}
                                        {/*<p className="names-count">Днів</p>*/}
                                        {/*<p className="names-count hours-margin">Годин</p>*/}
                                        {/*<p className="names-count minutes-margin">Хвилин</p>*/}
                                        {/*<p className="names-count">Секунд</p>*/}
                                    {/*</div>*/}
                                {/*</div>*/}
                                <p className="countdown-banner-text">Ярмарок почався!</p>
                                <p className="banner-time">26-27 вересня. 11:00 - 18:00</p>
                            </div>
                        </div>
                    </div>
                </div>

                {
                    isTranslationOn
                        ? (
                            <Element
                                id="hour-with-company-stream"
                                name="hour-with-company-stream"
                                className="element">
                                <div className="container-fluid padding-tb-20">
                                    <div className="row">
                                        <div className="col-12 text-center">
                                            <span className="bunch-header-mobile font-weight-600">Стрім «Година з компанією»</span>
                                        </div>
                                    </div>

                                    <div className="row margin-top-20">
                                        <div className="col-12 text-center">
                                            <span className="bunch-subheader font-weight-400">Дивись години з компаніями та бери участь у різних активностях під час івенту</span>
                                        </div>
                                    </div>

                                    <div className="row margin-top-40 margin-bottom-40">
                                        <div className="col-12 text-center">
                                            <a
                                                target="_blank"
                                                href={"https://youtu.be/W7ipkmhsVPM"}
                                                id={"width-button"}>
                                                <button
                                                    onClick={evt => {
                                                        ReactGA.event({
                                                            category: 'Hour With Company',
                                                            action: `Click Link To Stream`,
                                                        });
                                                    }}
                                                    className={`bunch-button-channel font-weight-500`}>
                                                    Дивитись стрім
                                                </button>
                                            </a>
                                        </div>
                                        {/*<div className="col-12 text-center">*/}
                                            {/*<iframe*/}
                                                {/*width="320"*/}
                                                {/*height="240"*/}
                                                {/*src={`https://www.youtube.com/embed/${videoId}?autoplay=1`}*/}
                                                {/*frameBorder="0"*/}
                                                {/*allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"*/}
                                                {/*allowFullScreen*/}
                                            {/*/>*/}
                                        {/*</div>*/}
                                    </div>

                                    {/*<div className="row margin-top-20">*/}
                                    {/*<div className="col-12 text-center">*/}
                                    {/*<iframe*/}
                                    {/*allowFullScreen=""*/}
                                    {/*frameBorder="0"*/}
                                    {/*width="320"*/}
                                    {/*height="240"*/}
                                    {/*src={`https://www.youtube.com/live_chat?v=${videoId}&embed_domain=${window.location.hostname}`}*/}
                                    {/*/>*/}
                                    {/*</div>*/}
                                    {/*</div>*/}

                                    <div className="row margin-top-20">
                                        <div className="col-12 text-center">
                                        <span className="bunch-subheader font-weight-400">Підписуйся на канал та знаходь відповіді на свої питання у чаті учасників{" "}
                                            <span className="bunch-bcfo-underline">
                                                <a
                                                    target="_blank"
                                                    onClick={evt => {
                                                        ReactGA.event({
                                                            category: 'Bunch Marketing',
                                                            action: `Click Button`,
                                                            label: 'Telegram Channel @bcfo_chat',
                                                        });
                                                    }}
                                                    href="https://t.me/bcfo_chat"
                                                    className="bunch-bcfo-a">
                                                    BCFO Chat
                                                </a>
                                            </span>
                                        </span>
                                        </div>
                                    </div>

                                    <div className="row margin-top-20">
                                        <div className="col-12 text-center">
                                            <img
                                                alt={"Стрілочка Вниз"}
                                                src={srcArrowDown}
                                                className={"bunch-arrow"}
                                            />
                                        </div>
                                    </div>

                                    <div className="row margin-top-20">
                                        <div className="col-12 text-center row-center">
                                            <a
                                                target="_blank"
                                                href={"https://t.me/bcfo_chat"}
                                                id={"width-button"}>
                                                <button
                                                    onClick={evt => {
                                                        ReactGA.event({
                                                            category: 'Bunch Marketing',
                                                            action: `Click Button`,
                                                            label: 'Telegram Channel @bcfo_chat',
                                                        });
                                                    }}
                                                    className={`bunch-button-channel font-weight-500`}>
                                                    Telegram BCFO Chat
                                                </button>
                                            </a>
                                        </div>
                                    </div>
                                </div>
                            </Element>
                        ) : null
                }

                <Element
                    id="hour-with-company-program"
                    name="hour-with-company-program"
                    className="element">
                    <div className="container-fluid padding-tb-60">
                        <div className="row">
                            <div className="col-12 text-center">
                                <span className="bunch-header-mobile font-weight-600">Програма Годин з компаніями</span>
                            </div>
                        </div>

                        <div className="row margin-top-20">
                            <div className="col-12 text-center">
                                <span className="bunch-subheader font-weight-400">
                                    Вакансії, стажування, кар'єрні лайфхаки — всі можливості для студентів за годину!
                                </span>
                            </div>
                        </div>

                        <div className="row margin-top-40">
                            <div className="col-12 text-center">
                                <Tabs
                                    defaultIndex={1}>
                                    <TabList>
                                        <Tab>
                                            <span className="font-weight-500">
                                                26 вересня, субота
                                            </span>
                                        </Tab>
                                        <Tab>
                                            <span className="font-weight-500">
                                                27 вересня, неділя
                                            </span>
                                        </Tab>
                                    </TabList>

                                    <TabPanel>
                                        <div className="row margin-top-40">
                                            <div className="col-12 text-center">
                                                <table className="table bunch-program-table-mobile">
                                                    <thead>
                                                    <tr>
                                                        <th scope="col">#</th>
                                                        <th scope="col">Час проведення</th>
                                                        <th scope="col">Від компанії</th>
                                                    </tr>
                                                    </thead>
                                                    <tbody>
                                                    <tr
                                                        style={{
                                                            backgroundColor:
                                                                Date.now() >= 1601107200000 &&
                                                                Date.now() <= 1601110800000
                                                                    ? "#fff17f"
                                                                    : null
                                                        }}>
                                                        <th scope="row">1</th>
                                                        <td>11:00-12:00 🕦</td>
                                                        <td>Coca-Cola HBC</td>
                                                    </tr>
                                                    <tr
                                                        style={{
                                                            backgroundColor:
                                                                Date.now() >= 1601110800000 &&
                                                                Date.now() <= 1601114400000
                                                                    ? "#fff17f"
                                                                    : null
                                                        }}>
                                                        <th scope="row">2</th>
                                                        <td>12:00-13:00 🕛</td>
                                                        <td>JTI</td>
                                                    </tr>
                                                    <tr
                                                        style={{
                                                            backgroundColor:
                                                                Date.now() >= 1601114400000 &&
                                                                Date.now() <= 1601118000000
                                                                    ? "#fff17f"
                                                                    : null
                                                        }}>
                                                        <th scope="row">3</th>
                                                        <td>13:00-14:00 🕐</td>
                                                        <td>Baker Tilly</td>
                                                    </tr>
                                                    <tr
                                                        style={{
                                                            backgroundColor:
                                                                Date.now() >= 1601118000000 &&
                                                                Date.now() <= 1601121600000
                                                                    ? "#fff17f"
                                                                    : null
                                                        }}>
                                                        <th scope="row">4</th>
                                                        <td>14:00-15:00 🕑</td>
                                                        <td>Goldman Sachs</td>
                                                    </tr>
                                                    <tr
                                                        style={{
                                                            backgroundColor:
                                                                Date.now() >= 1601121600000 &&
                                                                Date.now() <= 1601125200000
                                                                    ? "#fff17f"
                                                                    : null
                                                        }}>
                                                        <th scope="row">5</th>
                                                        <td>15:00-16:00 🕒</td>
                                                        <td>EY</td>
                                                    </tr>
                                                    <tr
                                                        style={{
                                                            backgroundColor:
                                                                Date.now() >= 1601125200000 &&
                                                                Date.now() <= 1601128800000
                                                                    ? "#fff17f"
                                                                    : null
                                                        }}>
                                                        <th scope="row">6</th>
                                                        <td>16:00-17:00 🕔</td>
                                                        <td>Citi</td>
                                                    </tr>
                                                    <tr
                                                        style={{
                                                            backgroundColor:
                                                                Date.now() >= 1601128800000 &&
                                                                Date.now() <= 1601132400000
                                                                    ? "#fff17f"
                                                                    : null
                                                        }}>
                                                        <th scope="row">7</th>
                                                        <td>17:00-18:00 🕧</td>
                                                        <td>Genesis</td>
                                                    </tr>
                                                    </tbody>
                                                </table>
                                            </div>
                                        </div>
                                    </TabPanel>

                                    <TabPanel>
                                        <div className="row margin-top-40">
                                            <div className="col-12 text-center">
                                                <table className="table bunch-program-table-mobile">
                                                    <thead>
                                                    <tr>
                                                        <th scope="col">#</th>
                                                        <th scope="col">Час проведення</th>
                                                        <th scope="col">Від компанії</th>
                                                    </tr>
                                                    </thead>
                                                    <tbody>
                                                    <tr
                                                        style={{
                                                            backgroundColor:
                                                                Date.now() >= 1601193600000 &&
                                                                Date.now() <= 1601197200000
                                                                    ? "#fff17f"
                                                                    : null
                                                        }}>
                                                        <th scope="row">1</th>
                                                        <td>11:00-12:00 🕦</td>
                                                        <td>Metinvest</td>
                                                    </tr>
                                                    <tr
                                                        style={{
                                                            backgroundColor:
                                                                Date.now() >= 1601197200000 &&
                                                                Date.now() <= 1601200800000
                                                                    ? "#fff17f"
                                                                    : null
                                                        }}>
                                                        <th scope="row">2</th>
                                                        <td>12:00-13:00 🕛</td>
                                                        <td>INTERTOP Ukraine</td>
                                                    </tr>
                                                    <tr
                                                        style={{
                                                            backgroundColor:
                                                                Date.now() >= 1601200800000 &&
                                                                Date.now() <= 1601204400000
                                                                    ? "#fff17f"
                                                                    : null
                                                        }}>
                                                        <th scope="row">3</th>
                                                        <td>13:00-14:00 🕐</td>
                                                        <td>KPMG</td>
                                                    </tr>
                                                    <tr
                                                        style={{
                                                            backgroundColor:
                                                                Date.now() >= 1601204400000 &&
                                                                Date.now() <= 1601208000000
                                                                    ? "#fff17f"
                                                                    : null
                                                        }}>
                                                        <th scope="row">4</th>
                                                        <td>14:00-15:00 🕑</td>
                                                        <td>Roland Berger</td>
                                                    </tr>
                                                    <tr
                                                        style={{
                                                            backgroundColor:
                                                                Date.now() >= 1601208000000 &&
                                                                Date.now() <= 1601211600000
                                                                    ? "#fff17f"
                                                                    : null
                                                        }}>
                                                        <th scope="row">5</th>
                                                        <td>15:00-16:00 🕒</td>
                                                        <td>Dentsu Aegis Network Ukraine</td>
                                                    </tr>
                                                    <tr
                                                        style={{
                                                            backgroundColor:
                                                                Date.now() >= 1601211600000 &&
                                                                Date.now() <= 1601215200000
                                                                    ? "#fff17f"
                                                                    : null
                                                        }}>
                                                        <th scope="row">6</th>
                                                        <td>16:00-17:00 🕔</td>
                                                        <td>ВАТ</td>
                                                    </tr>
                                                    </tbody>
                                                </table>
                                            </div>
                                        </div>
                                    </TabPanel>
                                </Tabs>
                            </div>
                        </div>

                        <div className="row margin-top-20">
                            <div className="col-12 text-center">
                                <span className="bunch-subheader font-weight-400 margin-top-20">
                                    Підписуйся на наш канал з усіма актуальними новинами фесту
                                    <span className="bunch-bcfo-underline">
                                        <a
                                            target="_blank"
                                            onClick={evt => {
                                                ReactGA.event({
                                                    category: 'Bunch Marketing',
                                                    action: `Click Button`,
